const MISAResource = {
    MISANotify: {
        Error: {
            Title:"Lỗi!"
        },
        Success: {
            Title:"Thành công!"
        },
        Warning:{
            Title:"Cảnh báo!"
        },
        Info:{
            Title: "Thông tin!"
        }
    }
}
export default MISAResource
